import "mapbox-gl/dist/mapbox-gl.css";
import Map, { Layer, Source, MapRef, Marker } from "react-map-gl";
import React, {useRef, useState } from "react";
import { latLngToCell, cellToBoundary } from "h3-js";
import Papa from "papaparse";

const singaporeHexagonsObj = require('../data/singapore_hexagons.json');
const singaporeHexagonsArr = [];
const maxBookingCount = 0;
const minBookingCount = Infinity;

// Convert hexagons object to an array for easier data management
function initHexagonArr() {
  for (const hexagon in singaporeHexagonsObj) {
    singaporeHexagonsArr.push({
      hexindex7: hexagon
    });
  }
}

function updateMinMaxBookingCounts() {
  for (const hexagon in singaporeHexagonsObj) {
    console.log("hi");
    if (singaporeHexagonsObj.hexagon > maxBookingCount) {
      maxBookingCount = singaporeHexagonsObj.hexagon;
    }
    if (singaporeHexagonsObj.hexagon < minBookingCount) {
      minBookingCount = singaporeHexagonsObj.hexagon;
    }
  }
  console.log("min: " + minBookingCount + " / " + "max: " + maxBookingCount);
}

// Count how many bookings are in each hexagon
function updateHexagonBookingCounts(bookings) {

  bookings.forEach((element) => {

    // console.log(element);

    if (element.latitude != null && element.longitude != null) {
      const bookingHexindex7 = latLngToCell(parseFloat(element.latitude), parseFloat(element.longitude), 7);

      // If the booking falls in a specific hexagon, increment the booking count
      if (singaporeHexagonsObj.hasOwnProperty(bookingHexindex7)) {
        singaporeHexagonsObj[bookingHexindex7]++;
      }

    } else {
      console.log("missing data: " + element.taxi_id);
    }
  });
}


function MapBox() {

  const [arr, setArr] = useState([]);

  const onLoad = () => {
    // console.log("onLoad() called");
    initHexagonArr();
    getData();
  };


  async function getData() {
    const response = await fetch("./assets/booking_data.csv");

    // console.log(response);

    if (response) {
      const reader = response?.body?.getReader();
      const result = await reader?.read(); // raw array



      const decoder = new TextDecoder("utf-8");
      const csv = decoder.decode(result?.value); // the csv text
      const results = Papa.parse(csv, { header: true }); // object with { data, errors, meta }

      // console.log(results);

      const bookingData = results.data; // array of objects

      // Iterate through booking data and check which hexagon it falls in and increment the booking count for that hexagon
      updateHexagonBookingCounts(bookingData);
      updateMinMaxBookingCounts();

      console.log(singaporeHexagonsObj);

      // console.log(rows);
      // console.log(singaporeHexagonsArr);
      const rs = singaporeHexagonsArr.map((row) => {
        const style = getStyle(row);
        return {
          type: "Feature",
          properties: {
            color: style.color,
            opacity: style.opacity,
            id: row.hexindex7,
          },
          geometry: {
            type: "Polygon",
            coordinates: [cellToBoundary(row.hexindex7, true)],
          },
        };
      });
      setArr(rs);

      // console.log(rs);
    }
  }

  const getStyle = (row) => {


    // console.log(row);

    const styles = [
      {
        color: '#FEDD87',
        opacity: 0.3
      },
      {
        color: '#FED976',
        opacity: 0.4
      },
      {
        color: "#FC9653",
        opacity: 0.5,
      },
      {
        color: "#F77645",
        opacity: 0.6
      },
      {
        color: "#E14C48",
        opacity: 0.7
      }
    ];

    const hexindex7 = row.hexindex7;
    const hexagonBookingCount = singaporeHexagonsObj[hexindex7];
    // const hexagonBookingCount = Math.floor(Math.random() * 10);

    if (Number(hexagonBookingCount) === 0) {
      return {opacity: 0};
    }


    if (Number(hexagonBookingCount) < 500) {
      return {
        color: '#FEDD87',
        opacity: 0.4,
      }
    }
    if (Number(hexagonBookingCount) < 1000) {
      return {
        color: "#FC9653",
        opacity: 0.5,
      };
    }
    if (Number(hexagonBookingCount) < 1500) {
      return {
        color: "#F77645",
        opacity: 0.6
      }
    }
    return {
      color: "#E14C48",
      opacity: 0.7
    };
  };

  // console.log(cellToBoundary(hexindex7Id, true));
  // console.log("arr:");
  // console.log(arr);



  return (

      <div>
        <div className="map">
          <Map
            initialViewState={{
              latitude: 1.290270,
              longitude: 103.851959,
              zoom: 10,
              bearing: 0,
              pitch: 0,
            }}
            mapStyle="mapbox://styles/mapbox/light-v9"
            mapboxAccessToken="pk.eyJ1IjoidGhlcHJvZiIsImEiOiJja3Q5amlqaXgxNjUwMm5wY3NrdmplbzVxIn0.C3zhU7lekidOJmARhNyBdw"
            style={{
              height: "100vh",
              width: "100vw",
            }}
            onLoad={onLoad}
          >
            <Source
              type="geojson"
              data={{
                type: "FeatureCollection",
                features: arr
              }}
            >
              <Layer
                {...{
                  id: "polyline-layer",
                  type: "fill",
                  paint: {
                    'fill-outline-color': 'white',
                    "fill-color": ["get", "color"],
                    "fill-opacity": ["get", "opacity"],
                  },
                }}
              />
            </Source>



          </Map>
        </div> 
      </div>
  );

};

export default MapBox;
